import { useNavigate } from "react-router-dom";

export default function OrderSuccess() {
  const navigate = useNavigate();
  const orderInfo = JSON.parse(localStorage.getItem("order")) || null;

  if (!orderInfo) {
    return (
      <div style={{ textAlign: "center", marginTop: "50px" }}>
        <h2>No recent order found!</h2>
        <button onClick={() => navigate("/")}>Back to Home</button>
      </div>
    );
  }

  const totalPrice = orderInfo.items.reduce(
    (acc, item) => acc + item.price * (item.quantity || 1),
    0
  );

  const estimatedTime = new Date();
  estimatedTime.setHours(estimatedTime.getHours() + 2); // 2 hours delivery estimate

  return (
    <div
      style={{
        maxWidth: "800px",
        margin: "60px auto",
        padding: "20px",
        borderRadius: "15px",
        boxShadow: "0 6px 20px rgba(0,0,0,0.15)",
        backgroundColor: "#fff",
        fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
      }}
    >
      <h1 style={{ color: "#28a745", textAlign: "center" }}>ðŸŽ‰ Order Confirmed!</h1>
      <p style={{ textAlign: "center", marginBottom: "20px" }}>
        Thank you <strong>{orderInfo.name}</strong>! Your order has been successfully placed.
      </p>

      <h3>Delivery Details</h3>
      <p><strong>Name:</strong> {orderInfo.name}</p>
      <p><strong>Email:</strong> {orderInfo.email}</p>
      <p><strong>Phone:</strong> {orderInfo.phone}</p>
      <p><strong>Address:</strong> {orderInfo.address}</p>
      <p><strong>Location:</strong> {orderInfo.location}</p>
      <p><strong>Payment Method:</strong> {orderInfo.payment}</p>
      <p><strong>Estimated Delivery:</strong> {estimatedTime.toLocaleTimeString()}</p>

      <h3>Ordered Items</h3>
      <ul style={{ listStyle: "none", padding: 0 }}>
        {orderInfo.items.map((item) => (
          <li key={item._id} style={{ display: "flex", justifyContent: "space-between", marginBottom: "8px" }}>
            <span>{item.title} x {item.quantity || 1}</span>
            <span>â‚¹{item.price * (item.quantity || 1)}</span>
          </li>
        ))}
      </ul>
      <p style={{ textAlign: "right", fontWeight: 700, fontSize: "1.2rem" }}>Total: â‚¹{totalPrice}</p>

      <div style={{ textAlign: "center", marginTop: "20px" }}>
        <button
          style={{
            padding: "12px 25px",
            backgroundColor: "#ff6f61",
            color: "#fff",
            border: "none",
            borderRadius: "10px",
            cursor: "pointer",
          }}
          onClick={() => navigate("/")}
        >
          Back to Home
        </button>
      </div>
    </div>
  );
}
